06f\u006e\u0074\u0073\u0065\u0072\u0072\u0061\u0074\u002f\u004a\u0054\u0055\u0048\u006a\u0049\u0067\u0031\u005f\u0069\u0036\u0074\u0038\u006b\u0043\u0048\u004b\u006d\u0034\u0035\u0033\u0032\u0056\u004a\u004f\u0074\u0035\u002d\u0051\u004e\u0046\u0067\u0070\u0043\u0075\u004d\u0037\u0033\u0077\u0039\u0061\u0058\u0078\u002d\u0070\u0037\u004b\u0034\u0047\u004c\u0076\u007a\u0074\u0067\u002e\u0077\u006f\u0066\u0066\u0029\u0020\u0066\u006f\u0072\u006d\u0061\u0074\u0028\u0027\u0077\u006f\u0066\u0066\u0027\u0029\u003b\u000a\u0020\u0020\u0075\u006e\u0069\u0063\u006f\u0064\u0065\u002d\u0072\u0061\u006e\u0067\u0065\u003a\u0020\u0055\u002b\u0030\u0033\u0030\u0031\u002c\u0020\u0055\u002b\u0030\u0034\u0030\u0030\u002d\u0030\u0034\u0035\u0046\u002c\u0020\u0055\u002b\u0030\u0034\u0039\u0030\u002d\u0030\u0034\u0039\u0031\u002c\u0020\u0055\u002b\u0030\u0034\u0042\u0030\u002d\u0030\u0034\u0042\u0031\u002c\u0020\u0055\u002b\u0032\u0031\u0031\u0036\u003b\u000a\u007d\u000a\u002f\u002a\u0020\u0076\u0069\u0065\u0074\u006e\u0061\u006d\u0065\u0073\u0065\u0020\u002a\u002f\u000a\u0040\u0066\u006f\u006e\u0074\u002d\u0066\u0061\u0063\u0065\u0020\u007b\u000a\u0020\u0020\u0066\u006f\u006e\u0074\u002d\u0066\u0061\u006d\u0069\u006c\u0079\u003a\u0020\u0027\u004d\u006f\u006e\u0074\u0073\u0065\u0072\u0072\u0061\u0074\u0027\u003b\u000a\u0020\u0020\u0066\u006f\u006e\u0074\u002d\u0073\u0074\u0079\u006c\u0065\u003a\u0020\u006e\u006f\u0072\u006d\u0061\u006c\u003b\u000a\u0020\u0020\u0066\u006f\u006e\u0074\u002d\u0077\u0065\u0069\u0067\u0068\u0074\u003a\u0020\u0037\u0030\u0030\u003b\u000a\u0020\u0020\u0066\u006f\u006e\u0074\u002d\u0064\u0069\u0073\u0070\u006c\u0061\u0079\u003a\u0020\u0073\u0077\u0061\u0070\u003b\u000a\u0020\u0020\u0073\u0072\u0063\u003a\u0020\u0075\u0072\u006c\u0028\u0068\u0074\u0074\u0070\u0073\u003a\u002f\u002f\u0067\u006f\u006c\u0069\u006b\u0065\u002e\u0063\u006f\u006d\u002e\u0076\u006e\u002f\u0077\u0070\u002d\u0063\u006f\u006e\u0074\u0065\u006e\u0074\u002f\u0066\u006f\u006e\u0074\u0073\u002
